import { BrowserRouter, Route, Router } from "react-router-dom";
import Cards from "./componetns/Cards";
import Footerres from "./componetns/Footerres";
import Home from "./componetns/Home";
import Navbares from "./componetns/Navbares";
import 'bootstrap/dist/css/bootstrap.min.css';
import Addrestaurant from "./pages/addRestaurants/Addrestaurant";




function App() {
  return (
   <div>
    <BrowserRouter>
        <Navbares />
        <Router>
          <Route path="/home" to={<Home />} />
          <Route path="/addres" to={<Addrestaurant />} />
        </Router>
        <Footerres />
      </BrowserRouter>
   </div>
  );
}

export default App;
